import logo from './logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>
          SYSTEMS
        </h1>
        <p>
         Ever Growing Contacts.
        </p>
        <a>Contact Us</a>
      </header>
    </div>
  );
}

export default App;
